    <p>{`管理导入的集群时，Rancher 将连接到一个已经设置好的 Kubernetes 集群，设置 Rancher Agent 与集群通信，不负责提供 Kubernetes。`}</p>
    <p>{`Rancher 的集群管理基于角色的访问控制策略，策略管理和工作负载等功能在导入集群中可用。请注意，Rancher 中不能配置或扩展导入的集群。`}</p>
    <p>{`对于除 K3s 集群外的所有导入的 Kubernetes 集群，必须在 Rancher 外部编辑集群的配置，您需要自己在集群中修改 Kubernetes 组件的参数、升级 Kubernetes 版本以及添加或删除节点。`}</p>
    <p>{`Rancher v2.4 支持编辑导入的 K3s 集群，您可以在 Rancher UI 中编辑集群来升级 Kubernetes 的功能。`}</p>
    <h2 {...{
      "id": "功能"
    }}>{`功能`}</h2>
    <p>{`在将集群导入到 Rancher 以后，集群所有者可以执行以下操作：`}</p>
    <ul>
      <li parentName="ul">{`通过基于角色的访问控制`}<a parentName="li" {...{
          "href": "/docs/rancher2/admin-settings/rbac/cluster-project-roles/_index"
        }}>{`管理集群访问`}</a>{`。`}</li>
      <li parentName="ul">{`启用`}<a parentName="li" {...{
          "href": "/docs/rancher2/cluster-admin/tools/monitoring/_index"
        }}>{`监控`}</a>{`和`}<a parentName="li" {...{
          "href": "/docs/rancher2/logging/2.0.x-2.4.x/project-logging/_index"
        }}>{`日志`}</a></li>
      <li parentName="ul">{`启用`}<a parentName="li" {...{
          "href": "/docs/rancher2/istio/2.3.x-2.4.x/_index"
        }}>{`Istio`}</a></li>
      <li parentName="ul">{`启用`}<a parentName="li" {...{
          "href": "/docs/rancher2/cluster-admin/tools/opa-gatekeeper/_index/"
        }}>{`OPA Gatekeeper`}</a></li>
      <li parentName="ul">{`使用`}<a parentName="li" {...{
          "href": "/docs/rancher2/project-admin/pipelines/_index"
        }}>{`流水线`}</a></li>
      <li parentName="ul">{`配置`}<a parentName="li" {...{
          "href": "/docs/rancher2/monitoring-alerting/2.0-2.4/cluster-alerts/_index"
        }}>{`告警`}</a>{`和`}<a parentName="li" {...{
          "href": "/docs/rancher2/monitoring-alerting/2.0-2.4/notifiers/_index"
        }}>{`通知`}</a></li>
      <li parentName="ul">{`管理`}<a parentName="li" {...{
          "href": "/docs/rancher2/project-admin/_index"
        }}>{`项目`}</a>{`和`}<a parentName="li" {...{
          "href": "/docs/rancher2/k8s-in-rancher/workloads/_index"
        }}>{`工作负载`}</a></li>
    </ul>
    <p>{`导入 K3s 集群后，集群所有者还可以`}<a parentName="p" {...{
        "href": "/docs/rancher2/cluster-admin/upgrading-kubernetes/_index"
      }}>{`从 Rancher UI 升级 Kubernetes 版本`}</a>{`。`}</p>
    <h2 {...{
      "id": "先决条件"
    }}>{`先决条件`}</h2>
    <p>{`如果您现有的 Kubernetes 集群已经定义了一个`}<inlineCode parentName="p">{`集群管理员`}</inlineCode>{`角色，那么您必须拥有这个`}<inlineCode parentName="p">{`集群管理员`}</inlineCode>{`特权才能将集群导入 Rancher。`}</p>
    <p>{`为了获得特权, 您需要运行：`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`kubectl create clusterrolebinding cluster-admin-binding \\
  --clusterrole cluster-admin \\
  --user [USER_ACCOUNT]
`}</code></pre>
    <p>{`默认情况下，GKE 用户不会获得此权限，因此您需要在导入 GKE 集群之前运行该命令。要了解有关 GKE 基于角色的访问控制的详细信息，请单击`}<a parentName="p" {...{
        "href": "https://cloud.google.com/kubernetes-engine/docs/how-to/role-based-access-control"
      }}>{`此处`}</a>{`。`}</p>
    <blockquote>
      <p parentName="blockquote">{`如果要导入 K3s 集群，请确保`}<inlineCode parentName="p">{`cluster.yml`}</inlineCode>{`是可读。默认情况下它是受保护，在导入集群时，您需要访问此文件，如果您在使用`}<inlineCode parentName="p">{`root`}</inlineCode>{`用户导入集群，可以跳过此配置。有关详细信息，请参阅`}<a parentName="p" {...{
          "href": "#%E9%85%8D%E7%BD%AE-k3s-%E9%9B%86%E7%BE%A4%E4%BB%A5%E5%85%81%E8%AE%B8%E5%AF%BC%E5%85%A5%E5%88%B0-rancher"
        }}>{`配置 K3s 集群来允许导入到 Rancher 中`}</a></p>
    </blockquote>
    <h2 {...{
      "id": "导入非-k3s-集群"
    }}>{`导入非 K3s 集群`}</h2>
    <ol>
      <li parentName="ol">
        <p parentName="li">{`在 `}<strong parentName="p">{`集群`}</strong>{` 页, 单击 `}<strong parentName="p">{`添加`}</strong>{`。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`选择 `}<strong parentName="p">{`导入`}</strong>{`。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`输入 `}<strong parentName="p">{`集群名称`}</strong>{`。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`通过`}<strong parentName="p">{`成员角色`}</strong>{`来设置用户访问集群的权限。`}</p>
        <ul parentName="li">
          <li parentName="ul">{`单击`}<strong parentName="li">{`添加成员`}</strong>{`将需要访问这个集群的用户添加到成员中。`}</li>
          <li parentName="ul">{`在`}<strong parentName="li">{`角色`}</strong>{`下拉菜单中选择每个用户的权限。`}</li>
        </ul>
      </li>
      <li parentName="ol">
        <p parentName="li">{`单击 `}<strong parentName="p">{`创建`}</strong>{`。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`这里显示了需要`}<inlineCode parentName="p">{`集群管理员`}</inlineCode>{`特权的先决条件 (请参阅上面的`}<strong parentName="p">{`先决条件`}</strong>{`)的提示，其中包括了达到该先决条件的示例命令。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`将`}<inlineCode parentName="p">{`kubectl`}</inlineCode>{`命令复制到剪贴板，并在有着指向您要导入的集群的 kubeconfig 的节点上运行它。如果您不确定它是否正确配置，在运行 Rancher 中显示的命令之前，运行`}<inlineCode parentName="p">{`kubectl get nodes`}</inlineCode>{`来验证一下。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`如果您正在使用自签名证书，您将收到`}<inlineCode parentName="p">{`certificate signed by unknown authority`}</inlineCode>{`消息。要解决这个验证问题，请把 Rancher 中显示的`}<inlineCode parentName="p">{`curl`}</inlineCode>{`开头的命令复制到剪贴板中。并在有着指向您要导入的集群的 kubeconfig 的节点上运行它。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`在节点上运行完命令后, 单击 `}<strong parentName="p">{`完成`}</strong>{`。`}</p>
      </li>
    </ol>
    <p><strong parentName="p">{`结果：`}</strong></p>
    <ul>
      <li parentName="ul">{`您的集群创建成功并进入到`}<strong parentName="li">{`Pending`}</strong>{`（等待中）的状态。Rancher 正在向您的集群部署资源。`}</li>
      <li parentName="ul">{`在集群状态变为`}<strong parentName="li">{`Active`}</strong>{`（激活）状态后，您将可以开始访问您的集群。`}</li>
      <li parentName="ul">{`在`}<strong parentName="li">{`Active`}</strong>{`的集群中，默认会有两个项目：`}<inlineCode parentName="li">{`Default`}</inlineCode>{`项目（包括`}<inlineCode parentName="li">{`default`}</inlineCode>{`命名空间）和`}<inlineCode parentName="li">{`System`}</inlineCode>{`项目（包括`}<inlineCode parentName="li">{`cattle-system`}</inlineCode>{`、`}<inlineCode parentName="li">{`ingress-nginx`}</inlineCode>{`、`}<inlineCode parentName="li">{`kube-public`}</inlineCode>{` 和 `}<inlineCode parentName="li">{`kube-system`}</inlineCode>{`）。`}</li>
    </ul>
    <blockquote>
      <p parentName="blockquote"><strong parentName="p">{`注意：`}</strong>{`
您不能重新导入当前在 Rancher 设置中处于激活状态的集群.`}</p>
    </blockquote>
    <h2 {...{
      "id": "导入-k3s-集群"
    }}>{`导入 K3s 集群`}</h2>
    <p>{`您现在可以将 K3s Kubernetes 集群导入 Rancher。`}<a parentName="p" {...{
        "href": "/docs/k3s/_index"
      }}>{`K3s`}</a>{`是一个轻量级的，经过一致性认证的 Kubernetes 发行版。您还可以通过在 Rancher UI 中编辑 K3s 集群来升级 Kubernetes。`}</p>
    <h3 {...{
      "id": "导入的-k3s-集群的其他功能"
    }}>{`导入的 K3s 集群的其他功能`}</h3>
    <p><em parentName="p">{`自 v2.4.0 起可用`}</em></p>
    <p>{`导入 K3s 集群时，Rancher 会将其识别为 K3s，除了其他导入的集群支持的功能之外，Rancher UI 还提供以下功能：`}</p>
    <ul>
      <li parentName="ul">{`能够升级 K3s 版本。`}</li>
      <li parentName="ul">{`能够配置在升级集群时，同时可以升级的最大节点数。`}</li>
      <li parentName="ul">{`在主机详情页，能够查看（不能编辑）启动 K3s 集群时每个节点的 K3s 配置参数和环境变量。`}</li>
    </ul>
    <h3 {...{
      "id": "升级-k3s-集群"
    }}>{`升级 K3s 集群`}</h3>
    <blockquote>
      <p parentName="blockquote">{`在升级之前，请先备份集群。这是 Kubernetes 的最佳实践。升级使用外部数据库的高可用 K3s 集群时，请以关系数据库提供者建议的方式备份数据库。`}</p>
    </blockquote>
    <p><strong parentName="p">{`并发`}</strong>{`是用来定义升级期间允许的不可用的最大节点数。如果不可用的节点的数量大于这个值，则无法升级成功。如果升级失败，您可能需要手动修复或删除发生故障的节点，并再次进行升级。`}</p>
    <ul>
      <li parentName="ul"><strong parentName="li">{`control-plane 节并发：`}</strong>{` 同时升级的 Server 节点数量；也是最大不可用 Server 节点数量。`}</li>
      <li parentName="ul"><strong parentName="li">{`工作节点并发：`}</strong>{` 同时升级的 Worker 节点数量；也是最大不可用 Worker 节点数量。`}</li>
    </ul>
    <p>{`在 K3s 文档中，control-plane 节点称为 Server 节点。这些节点运行 Kubernetes Master 组件，该节点维护集群的所需状态。在 K3s 中，默认情况下，这些 control-plane 节点也可以运行用户的工作负载。`}</p>
    <p>{`同样在 K3s 文档中，具有 Wroker 角色的节点也称为 Agent 节点。默认情况下，可以将集群中部署的所有工作负载或 Pod 调度到这些节点。`}</p>
    <h3 {...{
      "id": "配置-k3s-集群以允许导入到-rancher"
    }}>{`配置 K3s 集群以允许导入到 Rancher`}</h3>
    <p>{`如果要导入 K3s 集群，请确保`}<inlineCode parentName="p">{`cluster.yml`}</inlineCode>{`可读。默认情况下它是受保护，在导入集群时，您需要访问此文件，如果您在使用`}<inlineCode parentName="p">{`root`}</inlineCode>{`用户导入集群，可以跳过此配置`}</p>
    <p>{`这可以通过在安装过程中使用`}<inlineCode parentName="p">{`--write-kubeconfig-mode 644`}</inlineCode>{`参数来实现：`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-shell"
      }}>{`curl -sfL https://get.k3s.io | sh -s - --write-kubeconfig-mode 644
`}</code></pre>
